import React, {Component} from 'react';
import './purchase.scss';
import {Link} from "react-router-dom";
class Purchase extends Component {
    componentDidMount(){
        //获取抢购的数据
        Axios.get('http://47.100.98.54:9019/api/scarebuy').then((res)=>{
            console.log(res.data.data)
            this.setState({
                scarebuy: res.data.data
            })
            console.log(9999)
            // console.log(this.state.scarebuy)
        })
    }
    render() {
        return (
            <div className="purchase mt01rem plr04rem">
                <Link to="/">
                    <img src={require("../../static/img/purchase/饿了么_03.jpg")} alt="品质套餐"/>
                </Link>
                <Link to="/">
                    <img src={require("../../static/img/purchase/饿了么_05.jpg")} alt="热门推荐"/>
                </Link>

            </div>
        );
    }
}

export default Purchase;
